import { FastField, Field } from "formik";
import React from "react";

export const CheckBox = ({ name, label, options }) => {
  return (
    <div className="form-check">
      <label htmlFor="">{label}</label>
      <FastField  name={name}>
        {() => (
          <div className="row">
            {options.map((o) => (
              <div className="d-flex justify-content-between align-items-start col-5 me-3">
                <label className="form-check-label" for="flexCheckDefault">
                  {o.title}
                </label>
                <input
                  className="form-check-input "
                  type="checkbox"
                  // name={name}
                  id="flexCheckDefault"
                />
              </div>
            ))}
          </div>
        )}
      </FastField>
      {/* <div className="row">
        {options.map((o) => (
          <div className="d-flex justify-content-between align-items-start col-5 me-3">
            <label className="form-check-label" for="flexCheckDefault">
              {o.title}
            </label>
            <input
              className="form-check-input "
              type="checkbox"
              name={name}
              id="flexCheckDefault"
            />
          </div>
        ))}
      </div> */}
    </div>
  );
};
